          "id": "gl-draw-line",
          "type": "line",
          "filter": ["all", ["==", "$type", "LineString"], ["!=", "mode", "static"]],
          "layout": { "line-cap": "round", "line-join": "round" },
          "paint": {
            "line-color": "#D20C0C",
            "line-dasharray": [0.2, 2],
            "line-width": 4
          }
        },
        {
          "id": "gl-draw-polygon-fill",
          "type": "fill",
          "filter": ["all", ["==", "$type", "Polygon"], ["!=", "mode", "static"]],
          "paint": {
            "fill-color": "#D20C0C",
            "fill-outline-color": "#D20C0C",
            "fill-opacity": 0.1
          }
        },
        {
          "id": "gl-draw-polygon-stroke-active",
          "type": "line",
          "filter": ["all", ["==", "$type", "Polygon"], ["!=", "mode", "static"]],
          "layout": { "line-cap": "round", "line-join": "round" },
          "paint": {
            "line-color": "#D20C0C",
            "line-dasharray": [0.2, 2],
            "line-width": 4
          }
        }
      ]
    });
    map.addControl(draw);

    document.getElementById('draw-line').addEventListener('click', () => draw.changeMode('draw_line_string'));
    document.getElementById('draw-polygon').addEventListener('click', () => draw.changeMode('draw_polygon'));

    document.getElementById('export').addEventListener('click', () => {
      const data = draw.getAll();
      if (data.features.length > 0) {
        const blob = new Blob([JSON.stringify(data)], {type: "application/json"});
        const url = URL.createObjectURL(blob);
        const a = document.createElement('a');
        a.href = url;
        a.download = 'drawing.geojson';
        document.body.appendChild(a);
        a.click();
        document.body.removeChild(a);
        URL.revokeObjectURL(url);
      } else {
        alert("No features drawn. Please draw a polyline or polygon first.");
      }
    });

    document.getElementById('import').addEventListener('click', () => document.getElementById('file-input').click());

    document.getElementById('file-input').addEventListener('change', function(e) {
      const file = e.target.files[0];
      const reader = new FileReader();
      reader.onload = function(e) {
        const geojson = JSON.parse(e.target.result);
        const layerId = 'imported-' + Date.now();
        map.addSource(layerId, { type: 'geojson', data: geojson });
        map.addLayer({
          id: layerId + '-fill',
          type: 'fill',
          source: layerId,
          paint: { 'fill-color': '#088', 'fill-opacity': 0.4 },
          filter: ['==', '$type', 'Polygon']
        });
        map.addLayer({
          id: layerId + '-line',
          type: 'line',
          source: layerId,
          paint: { 'line-color': '#088', 'line-width': 2 }
        });
        const toggleDiv = document.createElement('div');
        toggleDiv.innerHTML = `<input type="checkbox" id="${layerId}-toggle" class="layer-toggle" checked><label for="${layerId}-toggle">${file.name}</label>`;
        document.getElementById('layers-list').appendChild(toggleDiv);
        document.getElementById(`${layerId}-toggle`).addEventListener('change', function(e) {
          const vis = e.target.checked ? 'visible' : 'none';
          map.setLayoutProperty(layerId + '-fill', 'visibility', vis);
          map.setLayoutProperty(layerId + '-line', 'visibility', vis);
        });
      };
      reader.readAsText(file);
      this.value = '';
    });

    const geojsonLayers = {
      test2: { data: test2, color: '#e41a1c' },
      test3: { data: test3, color: '#377eb8' },
      test4: { data: test4, color: '#4daf4a' },
      test5: { data: test5, color: '#984ea3' }
    };

    map.on('load', () => {
      Object.entries(geojsonLayers).forEach(([id, { data, color }]) => {
        map.addSource(id, { type: 'geojson', data });
        map.addLayer({
          id: id + '-fill',
          type: 'fill',
          source: id,
          paint: { 'fill-color': color, 'fill-opacity': 0.4 },
          filter: ['==', '$type', 'Polygon']
        });
        map.addLayer({
          id: id + '-line',
          type: 'line',
          source: id,
          paint: { 'line-color': color, 'line-width': 2 }
        });
        const toggleDiv = document.createElement('div');
        toggleDiv.innerHTML = `<input type="checkbox" id="${id}-toggle" class="layer-toggle" checked><label for="${id}-toggle">${id}</label>`;
        document.getElementById('layers-list').appendChild(toggleDiv);
        document.getElementById(`${id}-toggle`).addEventListener('change', function(e) {
          const vis = e.target.checked ? 'visible' : 'none';
          map.setLayoutProperty(id + '-fill', 'visibility', vis);
          map.setLayoutProperty(id + '-line', 'visibility', vis);
        });
      });
    });
  </script>
</body>
</html>
